import React,{Component} from 'react'


class Banners extends Component {
    render() {
        return(
            <div className="mainbanner">
        <div id="main-banner" className="owl-carousel home-slider">
          <div className="item"> <a href="index.html"><img src="/https://www.google.com/maps/place/%C4%90%E1%BA%A0I+H%E1%BB%8CC+B%C3%81CH+KHOA+C%E1%BB%94NG+TR%E1%BA%A6N+%C4%90%E1%BA%A0I+NGH%C4%A8A/@21.0051014,105.8434403,17z/data=!3m1!4b1!4m5!3m4!1s0x3135ad5569f4fbf1:0x5bf30cadcd91e2c3!8m2!3d21.0051014!4d105.845629?hl=vi-VN" style={{height: '100%'}} width="100%" alt="main-banner1" className="img-responsive" /></a> </div>
          <div className="item"> <a href="index.html"><img src="../image/banners/07_Sep35af28d3770b8292b53a00e6468599ab.jpg" style={{height: '100%'}} width="100%" alt="main-banner2" className="img-responsive" /></a> </div>
          <div className="item"> <a href="index.html"><img src="../image/banners/09_Sep19ae7763cd670097dbc41a22b7827781.jpg" alt="main-banner3" className="img-responsive" /></a> </div>
        </div>
      </div>
        );
    }
}

export default Banners
